import React from 'react';
import Transition from 'react-transition-group/Transition';
import classes from './Final.module.css';

import Button from '../../components/UI/Button/Button';

export default function Final(props) {
    return (
        <div className={classes.Final}>
            <Transition
                in={props.show}
                timeout={500}
                mountOnEnter
                unmountOnExit>
                {state => {
                    return                 <div>
                    {/* einfaden lassen nacheinander */}
                    <h2>Herzlichen Glückwunsch</h2>
                    <p>Du hast alle Zitate mit {props.counter} Zügen gefunden.</p>
                    <p>Danke für´s Mitspielen!</p>
                
                <p>KLICKE HIER um den Link zu kopieren und schicke ihn an deine Freunde.</p>
                <h3>Noch eine Runde?</h3>
                {/* rein sliden links / rechts */}
                <Button
                    clickHandler={props.onStart}
                    type='button'
                    look='music'>
                    Musik
                </Button>
                <Button
                    clickHandler={props.onStart}
                    type='button'
                    look='literature'>
                    Literatur
                </Button>
                <Button
                    clickHandler={props.onStart}
                    type='button'
                    look='politics'>
                    Politik
                </Button>
                </div>
                }}

            </Transition>
        </div>
    )
};
